import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={"../public/github.png"} className="App-logo" alt="logo" />
        <p>
          cd to <code>src/demo-Handwritten-Arabic-Digits-Recogniton</code> and run app.py.
        </p>
        <a
          className="Hand Written Arabic Digits"
          href="https://https://github.com/kh-arif/demo-Handwritten-Arabic-Digits-Recognition"
          target="_blank"
          rel="noopener noreferrer"
        >
          Github Account 
        </a>
      </header>
    </div>
  );
}

export default App;
